import React from "react";
import { Container } from "react-bootstrap";
import "./Footerbar.scss";

function Footerbar() {
  return (
    <>
      <section>
        <Container>
          <div className="d-flex">
            <ul>
              <li>Terms</li>
              <li>Privacy Policy</li>
            </ul>
            <p>Copyright 2022 | All Rights Reserved.</p>
          </div>
        </Container>
      </section>
    </>
  );
}

export default Footerbar;
